import React from "react";

const Search = () => (
  <div className="search h-100 py-2">
    <ul className="nav nav-tabs nav-fill">
      <li className="nav-item">
        <a className="nav-link active" href="#">Search</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Code</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Bills</a>
      </li>
      <li className="nav-item">
        <a className="nav-link" href="#">Legislators</a>
      </li>
    </ul>

    <style jsx>{`
      search {
        border: 1px solid rgb(222, 226, 230);;
      }
    `}</style>
  </div>
);

export default Search;
